oxy_webhelp_navlinks = {"tocId-d22908e41719":{"topics":[{"title":"Multitenant organizations","shortdesc":"<p class=\"shortdesc\">Multitenancy in <span class=\"ph\">RSC<\/span> refers to the logical isolation of shared         compute, storage, and network resources in such a way that each organization can only see         and access data that belongs to that organization, especially for shared infrastructure         platforms.<\/p>","href":"saas\/mt_multitenant_organizations.html","attributes":{"data-id":"mt_multitenant_organizations"},"menu":{"hasChildren":true},"tocID":"mt_multitenant_organizations-d22908e41725","next":"mt_multitenant_organizations-d22908e41725"},{"title":"Multitenancy and Rubrik Envoy","shortdesc":"<p class=\"shortdesc\">With Rubrik Envoy, you can enable secure data movement between Rubrik clusters and a         tenant organization network.<\/p>","href":"cdm\/multitenancy_and_rubrik_envoy.html","attributes":{"data-id":"multitenancy_and_rubrik_envoy"},"menu":{"hasChildren":true},"tocID":"multitenancy_and_rubrik_envoy-d22908e42031","next":"multitenancy_and_rubrik_envoy-d22908e42031"},{"title":"Enabling stringent policies for organizations","shortdesc":"<p class=\"shortdesc\">An user with administrator privileges for a global organization can enable global         enforcement settings to enforce stricter policies for tenant organizations.<\/p>","href":"saas\/enabling_stringent_policies_organizations.html","attributes":{"data-id":"enabling_stringent_policies_organizations"},"menu":{"hasChildren":false},"tocID":"enabling_stringent_policies_organizations-d22908e42272","topics":[]}]}};